import "./App.css";
import MovieCrad from "./components/MovieCrad";
import movieList from "./components/MovieList";
import { Routes, Route } from "react-router-dom";

function renderMe(props) {
  return (
    <Routes>
      <route
        path="/"
        element={
          <MovieCrad
            imgURL={props.postURL}
            title={props.title}
            description={props.description}
          />
        }
      ></route>
    </Routes>
  );
}

function App() {
  return <div className="App">{movieList.map(renderMe)}</div>;
}

export default App;
